  `dataTemp` float NULL,
  `dataConv` float NULL,
  `dataP` float NULL,
  `dataSal` float NULL,
  `dataSV` float NULL,
  `dataPH` float NULL,
  `dataZ` float NULL,
  `dataY` float NULL,
  PRIMARY KEY (`timeTag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#建立MFish-8的历史数据表
CREATE TABLE if not exists DB_DATASET.`TAB_MFish-8_HISTORY` (
  `timeTag` datetime(3) NOT NULL,
  `devStatus` tinyInt not NULL default 0,
  `devDeep` float NULL,
  `devSpeed` float NULL,
  `dataTemp` float NULL,
  `dataConv` float NULL,
  `dataP` float NULL,
  `dataSal` float NULL,
  `dataSV` float NULL,
  `dataPH` float NULL,
  `dataZ` float NULL,
