  from DB_DATASET.`TAB_MFish-8_REALTIME` A, DB_DATASET.VW_LOCATION_REALTIME B, DB_DATASET.VW_DEEPDECT_REALTIME C
  where substring( A.timeTag, 1, 19 ) = B.timeTag and substring( A.timeTag, 1, 19 ) = C.timeTag
  group by substring( A.timeTag, 1, 19 ), B.timeTag, C.timeTag;

