declare i_dataCount int;  #KX字段数量
declare i_dataIndex int;  #KX相关的数据索引
declare s_devId varchar(20);  #在用仪器编号

#目前海深探测数据表满足KX海深探测信息要求，不用新建KX的实时数据表

